# creates a deck of cards in a list
def cardDeck():
    # creates a deck of cards in a list

    ranks = "23456789TJQKA"
    suits = "CDHS"
    deck = []

    # loop through all of the ranks and suits and append them to the card list
    for i in range(len(ranks)):
        for j in range(len(suits)):
            deck.append(ranks[i] + suits[j])

    return deck

# runs a simulation of a poker round given a pre flop hand
def preFlopHandWins(hand, numPlayers = 7):

    deck = cardDeck()
    for card in hand:
        deck.remove(card)

    cardOne = random.choice(deck)
    deck.remove(cardOne)
    cardTwo = random.choice(deck)
    deck.remove(cardTwo)
    cardThree = random.choice(deck)
    deck.remove(cardThree)
    cardFour = random.choice(deck)
    deck.remove(cardFour)
    cardFive = random.choice(deck)
    deck.remove(cardFive)

    board = [cardOne, cardTwo, cardThree, cardFour, cardFive]

    playerScore = chooseBestHand(hand, board)[1]

    opponentHands = []
    for i in range(numPlayers):
        cardOne = random.choice(deck)
        deck.remove(cardOne)
        cardTwo = random.choice(deck)
        deck.remove(cardTwo)
        opponentHands.append([cardOne, cardTwo])

    for opponent in opponentHands:
        if chooseBestHand(opponent, board)[1] > playerScore:
            return False
    return True

# runs a simulation of a poker round given a post flop hand and board
def postFlopHandWins(hand, board, numPlayers = 7):
    deck = cardDeck()
    for card in hand + board:
        deck.remove(card)
    
    cardOne = random.choice(deck)
    deck.remove(cardOne)
    cardTwo = random.choice(deck)
    deck.remove(cardTwo)
    fullBoard = board + [cardOne] + [cardTwo]
    playerScore = chooseBestHand(hand, fullBoard)[1]

    opponentHands = []
    for i in range(numPlayers):
        cardOne = random.choice(deck)
        deck.remove(cardOne)
        cardTwo = random.choice(deck)
        deck.remove(cardTwo)
        opponentHands.append([cardOne, cardTwo])

    for opponent in opponentHands:
        if chooseBestHand(opponent, fullBoard)[1] > playerScore:
            return False
    return True

