# generates a list of all of the possible hands to be dealt
def possibleHands():

    deck = cardDeck()
    possibleHands = []
    tempDeck = cardDeck()
    count = 0
    for card in deck:
        tempDeck.remove(card)
        for cardTwo in tempDeck:
            if [cardTwo, card] not in possibleHands:
                possibleHands.append([card, cardTwo])
                count += 1

        tempDeck.append(card)
    
    return possibleHands

