# generates a list of the condensed possible hands
def optimizedHands():
    optimizedHands = []
    hands = possibleHands()
    count = 0
    for hand in hands:
        # print(hand)
        if hand[0][1] == hand[1][1]:
            newHand = hand[0][0] + hand[1][0] + "s"
            if newHand not in optimizedHands:
                optimizedHands.append(newHand)
                count += 1
        else:
            newHand = hand[0][0] + hand[1][0] + "o"
            if newHand not in optimizedHands:
                optimizedHands.append(newHand)
                count += 1
    # print(count)
    optimizedHandsSet = set()
    for hand in optimizedHands:
        if hand[2] == "o":
            optimizedHandsSet.add((hand[0]+"S", hand[1]+"H"))
        else:
            optimizedHandsSet.add((hand[0]+"S", hand[1]+"S"))
        

    return optimizedHandsSet, optimizedHands

