    for hand in d:
        if hand[0][1] == hand[1][1]:
            joint[hand[0][0] + hand[1][0] + "s"] = d[hand]
        else:
            joint[hand[0][0] + hand[1][0] + "o"] = d[hand]
    
    dict1326 = {}
