# calculates pre flop player odds knowing all available information
def omniscientPlayerOddsPreFlop(app, numTrials = 100):

    playerOddsDictionary = {}
    for i in range(len(app.pokerPlayers)):
        playerOddsDictionary[i] = 0

    deck = cardDeck()
    playersIn = []
    for i in range(len(app.pokerPlayers)):
        hand = app.pokerPlayers[app.pokerPlayerImages[i][1]].playerHand
        deck.remove(hand[0])
        deck.remove(hand[1])
        if app.pokerPlayers[app.pokerPlayerImages[i][1]].playerIn:
            playersIn.append(app.pokerPlayers[app.pokerPlayerImages[i][1]].playerNum)

    for i in range(numTrials):

        cardOne = random.choice(deck)
        deck.remove(cardOne)
        cardTwo = random.choice(deck)
        deck.remove(cardTwo)
        cardThree = random.choice(deck)
        deck.remove(cardThree)
        cardFour = random.choice(deck)
        deck.remove(cardFour)
        cardFive = random.choice(deck)
        deck.remove(cardFive)

        board = [cardOne, cardTwo, cardThree, cardFour, cardFive]

        bestScore = 0
        playerNum = []

        for i in playersIn:
            if chooseBestHand(app.pokerPlayers[i].playerHand, board)[1] == bestScore:
                playerNum.append(i)
            elif chooseBestHand(app.pokerPlayers[i].playerHand, board)[1] > bestScore:
                bestScore = chooseBestHand(app.pokerPlayers[i].playerHand, board)[1]
                playerNum = [i]

        for player in playerNum:
            playerOddsDictionary[player] += 1
        
        deck.append(cardOne)
        deck.append(cardTwo) 
        deck.append(cardThree)
        deck.append(cardFour)
        deck.append(cardFive)

    return playerOddsDictionary

